import React from "react";
import { useState } from "react";
import { Button,DatePicker,TimePicker,Rate,FrownOutlined,MehOutlined,SmileOutlined} from "antd";
import 'antd/dist/antd.css'
import "./App.css"
import { type } from "@testing-library/user-event/dist/type";


const customIcons: Record<number, React.ReactNode> = {
   // 1: <FrownOutlined />,
   2: <FrownOutlined />,
   3: <MehOutlined />,
   4: <SmileOutlined />,
   5: <SmileOutlined />,
 };

const Cards = ({ name, change }) => {
    const [newName, setNewName] = useState(name);
    return (
       <div>
       <input
          placeholder="Enter new name"
          value={newName}
          onChange={(e) => setNewName(e.target.value)}
       />
       <Button onClick={() => change(newName )} type="primary">Change</Button><br/><br></br>
       <DatePicker placeholder="select date"></DatePicker>
       <TimePicker placeholder="Time"></TimePicker><br/>
       <Rate defaultValue={0} />
       <span className="ant-rate-text">Rate us</span>
       <br />
       <Rate defaultValue={2} character={({ index }: { index: number }) => index + 1} />
    <br />
       <Rate defaultValue={3} character={({ index }: { index: number }) => customIcons[index + 1]} />

       </div>
    );
 };
export default Cards;
